import React from 'react';
import styled from 'styled-components';

const Grid = styled.div`
    border: 2px solid red;
`

const Row = styled.div`
    display: flex;
`

const Col = styled.div`
    flex: ${(props) => props.size};
`

const GridComponent = () => {
    return (
        <div>
            <h1>Live Campaigns</h1>
            <Grid>
                <Row>
                    <Col size={2}>
                        Name
                    </Col>
                    <Col size={1}>
                        amount sent
                    </Col>
                    <Col size={1}>
                        click through rates
                    </Col>
                </Row>
            </Grid>
        </div>
    )
}

export default Grid;
